import {
	vec2,
	rgb,
	map,
} from "./math";

import {
	Assets,
} from "./assets";

import {
	Gfx,
} from "./gfx";

type Log = {
	type: "info" | "error",
	msg: string,
};

type LoggerOpt = {
	max?: number,
	time?: () => number,
};

type Logger = {
	draw(),
	info(msg: string),
	error(msg: string),
	clear(),
};

const LOG_SIZE = 16;

function loggerInit(gfx: Gfx, assets: Assets, opt: LoggerOpt = {}): Logger {

	let logs: Log[] = [];
	const max = opt.max ?? 1;

	// TODO: draw rects first to reduce draw calls
	function draw() {

		if (logs.length > max) {
			logs = logs.slice(0, max);
		}

		const pos = vec2(0, gfx.height());

		logs.forEach((log, i) => {

			const txtAlpha = map(i, 0, max, 1, 0.5);
			const bgAlpha = map(i, 0, max, 0.8, 0.2);

			const col = (() => {
				switch (log.type) {
					case "info": return rgb(255, 255, 255);
					case "error": return rgb(255, 0, 127);
				}
			})();

			const ftext = gfx.fmtText({
				text: log.msg,
				font: assets.fonts["sink"],
				pos: pos,
				origin: "botleft",
				color: col,
				size: LOG_SIZE / gfx.scale(),
				width: gfx.width(),
				opacity: txtAlpha,
			});

			gfx.drawRect({
				pos: pos,
				width: ftext.width,
				height: ftext.height,
				origin: "botleft",
				color: rgb(0, 0, 0),
				opacity: bgAlpha,
			});

			gfx.drawFmtText(ftext);
			pos.y -= ftext.height;

		});

	}

	function error(msg: string) {
		logs.unshift({
			type: "error",
			msg: msg,
		});
	}

	function info(msg: string) {
		logs.unshift({
			type: "info",
			msg: msg,
		});
	}

	function clear() {
		logs = [];
	}

	return {
		info,
		error,
		draw,
		clear,
	};

}

export {
	loggerInit,
};

