let numFrames = 0;

function frames() {
	return numFrames;
}

app.run(() => {

	numFrames++;
	gfx.frameStart();

	if (!game.loaded) {

		// if assets are not fully loaded, draw a progress bar
		const progress = assets.loadProgress();

		if (progress === 1) {
			game.loaded = true;
			game.trigger("load");
		} else {

			const w = width() / 2;
			const h = 24 / gfx.scale();
			const pos = vec2(width() / 2, height() / 2).sub(vec2(w / 2, h / 2));

			gfx.drawRect({
				pos: vec2(0),
				width: width(),
				height: height(),
				color: rgb(0, 0, 0),
			});

			gfx.drawRect({
				pos: pos,
				width: w,
				height: h,
				fill: false,
				outline: {
					width: 4 / gfx.scale(),
				},
			});

			gfx.drawRect({
				pos: pos,
				width: w * progress,
				height: h,
			});

		}

	} else {

		// TODO: this gives the latest mousePos in input handlers but uses cam matrix from last frame
		game.camMousePos = game.camMatrix.invert().multVec2(app.mousePos());
		game.trigger("input");
		gameFrame();

		if (debug.inspect) {
			drawInspect();
		}

		if (debug.showLog) {
			logger.draw();
		}

	}

	gfx.frameEnd();

});

if (gopt.debug !== false) {
	enterDebugMode();
}

if (gopt.burp) {
	enterBurpMode();
}

window.addEventListener("error", (e) => {
	logger.error(`Error: ${e.error.message}`);
	app.quit();
	app.run(() => {
		if (assets.loadProgress() === 1) {
			gfx.frameStart();
			logger.draw();
			gfx.frameEnd();
		}
	});
});

return ctx;

